import Tab from 'react-bootstrap/Tab';
import Tabs from 'react-bootstrap/Tabs';
import {Link} from "react-router-dom";

// Icons
import {
  MdOutlineDashboardCustomize,
  MdOutlineSettings,
} from "react-icons/md";
import {BiMessageDetail}  from "react-icons/bi";
import{FcGoogle} from "react-icons/fc"

// Style
import  "./Sidebartabs.scss";

function FillExample() {
    return (
      <Tabs
        defaultActiveKey="tab1"
        id="fill-tab-example"
        className=" sidebarTabs"
        fill
      >
        <Tab eventKey="tab1" title={<span><BiMessageDetail />{" "}</span>}>
            <div className='blueTape' >
              <h5>CHATTING SETTING </h5>
            </div>
        </Tab>
        <Tab eventKey="tab2" title={
          <span>
            <MdOutlineDashboardCustomize />{" "}
          </span>
        }>
            <div className='blueTape' >
              <h5>&nbsp;</h5>
            </div>
            <div className="dashfeat">
              <div>
              <Link to="/zillow-group">Zillow Group</Link>
                
              </div>
            </div>
        </Tab>
        <Tab eventKey="tab3" title={<span><MdOutlineSettings />{" "}</span>}>
            <div className='blueTape' >
              <h5>THEME SETTING </h5>
            </div>
        </Tab>

      </Tabs>
    );
  }
  
  export default FillExample;
